import React from 'react';
import { Link } from 'react-router-dom';
import '../home.css';

const Home = () => {
  return (
    <div className="homeContainer">
      <div className="welcome">
        SmartSlice Station
      </div>
      <div className="tabs">
        <Link to="/home" className="Home">Tab 1</Link>
        //<Link to="/tab2" className="tab">Tab 2</Link>
        //<Link to="/tab3" className="tab">Tab 3</Link>
        //<Link to="/tab4" className="tab">Tab 4</Link>
        //<Link to="/tab5" className="tab">Tab 5</Link>
      </div>
    </div>
  );
};

export default Home;
